/*	aboutsketch // cc teddavis.org 2019	*/

function setup() {
	createCanvas(windowWidth, windowHeight);
	noStroke();
	mouseX = width / 2;
	mouseY = height / 2;
}

function draw() {
	background(0);
	tri(0, 0, mouseX, mouseY, 0, height, 100);
	tri(0, 0, mouseX, mouseY, width, 0, 200);
	tri(width, height, mouseX, mouseY, 0, height, 0);
	tri(width, height, mouseX, mouseY, width, 0, 255);
}

function tri(x1, y1, x2, y2, x3, y3, fc) {
	var v = 0.002;
	fill(abs(sin(fc + (frameCount * v))) * 255);
	beginShape();
	vertex(x1, y1);
	vertex(x2, y2);
	vertex(x3, y3);
	endShape();
}

/*	bwEllipse // cc teddavis.org 2019	*/

function setup() {
	createCanvas(windowWidth, windowHeight);
}

function draw() {
	fill(255);
	stroke(255);
	if(frameCount % 2 == 0)
		stroke(0);
	strokeWeight(15);
	var oscX = sin(frameCount * 0.01) * width * .4;
	var oscY = sin(frameCount * 0.045) * height * .4;
	var s = sin(frameCount * 0.02) * 150;
	translate(width / 2, height / 2);
	ellipse(oscX, oscY, s, s);
}

/*	easeFunction // cc teddavis.org 2019	*/

var x = 0,
	y = 0,
	e = 0.05;

function setup() {
	createCanvas(windowWidth, windowHeight);
	fill(255);
}

function draw() {
	background(200);
	// built-in ease(inVal, outVal, easeVal) for smoothing values
	x = ease(mouseX, x, e);
	y = ease(mouseY, y, e);
	ellipse(x, y, 150, 150);
	text(nf(x, 3, 1) + " / " + nf(y, 3, 1), 0, height);

}

/*	sinStrings // cc teddavis.org 2019	*/

function setup() {
	createCanvas(windowWidth, windowHeight);
	mouseX = width * 0.4;
}

function draw() {
	background(200);
	var lc = 20;
	fill(0);
	for(var i = 0; i < lc; i++) {
		var s = width / lc;
		var x = map(i, 0, lc - 1, 0, width);
		var osc = sin((frameCount * .01) + i * map(mouseX, 0, width, 0, 5));
		var y = height / 2 + osc * abs(mouseY - height / 2);
		stroke(150);
		strokeWeight(2.1 - (osc * 2));
		line(x, y, x, 0);
		noStroke();
		ellipse(x, y, s, s);
	}
}

/*	wanderingWorm // cc teddavis.org 2019	*/

var x, y, nx, ny;
var s = 50.0;
var sMin = 25;
var sg = 2;
var nxv = 0.006;
var nyv = 0.005;

function setup() {
	createCanvas(windowWidth, windowHeight);
	noCursor();
	nx = random(width);
	ny = random(height);
	background(0);
}

function draw() {
	x = floor(noise(nx) * width);
	y = floor(noise(ny) * height);
	fill(255);
	if(mouseIsPressed) {
		s += sg;
	} else {
		s -= sg;
		if(s < sMin)
			s = sMin;
	}

	ellipse(x, y, s, s);

	nx += nxv;
	ny += nyv;
}

function keyPressed() {
	if(keyCode == 8)
		background(0);
}

/*	wanderingWorm // cc teddavis.org 2019
	+ tips: 
	https://p5js.org/reference/#/libraries/p5.sound 
	https://therewasaguy.github.io/p5-music-viz/	
*/

var mic, wave, fft;
var numSamples = 1024;
var numBands = 16;

function setup() {
	createCanvas(windowWidth, windowHeight);
	noFill();

	mic = new p5.AudioIn();
	mic.start();
	wave = new p5.FFT(0.5, numSamples);
	fft = new p5.FFT(0.75, numBands);
	wave.setInput(mic);
	fft.setInput(mic);
}

function draw() {
	background(150);
	noFill();
	strokeWeight(2);

	// draw waveform
	stroke(0, 0, 255);
	var spectrum = wave.waveform(); // aud.analyze();
	beginShape();
	for(var i = 0; i < spectrum.length; i++) {
		var x = map(i, 0, spectrum.length - 1, 0, width);
		var y = map(spectrum[i], -1, 1, -height / 2, height / 2);
		vertex(x, y + height / 2);
	}
	endShape();

	// draw fft
	stroke(0);
	var spectrum = fft.analyze();
	beginShape();
	for(var i = 0; i < spectrum.length; i++) {
		var x = map(i, 0, spectrum.length - 1, 0, width);
		var y = map(spectrum[i], 0, 255, 0, height / 2);
		vertex(x, y + height / 2);
	}
	endShape();

	var s = mic.getLevel() * 1000;
	fill(0);
	noStroke();
	ellipse(width / 2, height / 2, s, s);
}

/*	webgl_sphereBox // cc teddavis.org 2019	*/

var lc = 8;

function setup() {
	createCanvas(windowWidth, windowHeight, WEBGL);
	noCursor();
	noStroke();

}

function draw() {
	ortho();
	background(0);
	for(var i = 0; i < lc; i++) {
		for(var j = 0; j < lc; j++) {
			var mx = map(i, 0, lc - 1, -width / 2, width / 2);
			var my = map(j, 0, lc - 1, -height / 2, height / 2);

			boxsphere(mx, my);
		}
	}
}

function boxsphere(x, y) {
	push();
	translate(x, y);
	var mmx = map(mouseX, 0, width, -width / 2, width / 2);
	var mmy = map(mouseY, 0, height, -height / 2, height / 2);
	var roff = -dist(mmx, mmy, x, y) / 2;
	rotateY(radians(frameCount + mouseX));
	rotateX(radians(mouseY));
	var s = (width / lc / 2) + roff;

	fill(255);
	if(mouseIsPressed) {
		fill(0);
	}
	box(s);

	fill(0);
	if(mouseIsPressed) {
		fill(255);
	}
	sphere(s * 0.65);
	pop();
}

/*	textToPoints // cc teddavis.org 2019	*/

var font, myText = "P5L";
var points = [];

// function preload() {
// 	font = loadFont('includes/fonts/RobotoMono-Regular.ttf');
// }

function setup() {
	createCanvas(windowWidth, windowHeight);
	stroke(255);
	font = loadFont('includes/fonts/RobotoMono-Regular.ttf', getPoints);
	//getPoints();
	rectMode(CENTER);
}

function draw() {
	background(0);
	translate(width / 4, height * .7);
	for(var i = 0; i < points.length; i++) {
		var pt = points[i];
		push();
		translate(pt.x, pt.y);
		rotate(radians(sin(frameCount * i * 0.00003) * 180));
		var w = dist(mouseX, mouseY, pt.x + width / 4, pt.y + height * .7) / 3;
		line(0, 0, w, w);
		pop();
	}
}

function getPoints() {
	var s = width / myText.length;
	points = font.textToPoints(myText, 0, 0, s);
	textFont(font);

}

